import React from 'react';
import {BrowserRouter as Router, Switch} from 'react-router-dom';

import './app.scss';
import * as Routes from './routes';

import { RouteWithLayout } from './utilities';
import * as Layouts from './layouts';
import * as Pages from './pages';

function App() {
  return (
    <div className="App">
      <Router basename='/'>
        <Switch>
          <RouteWithLayout exact path={Routes.WELCOME} component={Pages.WelcomePage} layout={Layouts.PreLayout} />
          <RouteWithLayout exact path={Routes.LOGIN} component={Pages.LoginPage} layout={Layouts.PreLayout} />
          <RouteWithLayout exact path={Routes.SIGNUP} component={Pages.SignupPage} layout={Layouts.PreLayout} />
          <RouteWithLayout exact path={Routes.ADRESS} component={Pages.AdressPage} layout={Layouts.PreLayout} />

          <RouteWithLayout exact path={Routes.CUSHOME} component={Pages.CusHomePage} layout={Layouts.CusLayout} />
          <RouteWithLayout exact path={Routes.CUSSEARCH} component={Pages.CusSearchPage} layout={Layouts.CusLayout} />
          <RouteWithLayout exact path={Routes.CUSPROFILE} component={Pages.CusProfilePage} layout={Layouts.CusLayout} />
          <RouteWithLayout exact path={Routes.CUSDETAIL} component={Pages.CusDetailPage} layout={Layouts.CusLayout} />
          <RouteWithLayout exact path={Routes.CUSPAYMENT} component={Pages.CusPaymentPage} layout={Layouts.PreLayout} />
          <RouteWithLayout exact path={Routes.CUSSUCCESFULL} component={Pages.CusSuccesPage} layout={Layouts.PreLayout} />

          <RouteWithLayout exact path={Routes.TRADASHBOARD} component={Pages.TraDashboardPage} layout={Layouts.TraLayout} />
          <RouteWithLayout exact path={Routes.TRADETAIL} component={Pages.TraDetailPage} layout={Layouts.TraLayout} />
          <RouteWithLayout exact path={Routes.TRAUSER} component={Pages.TraUserPage} layout={Layouts.TraLayout} />
          <RouteWithLayout exact path={Routes.TRAPROFILE} component={Pages.TraProfilePage} layout={Layouts.TraLayout} />
          <RouteWithLayout exact path={Routes.TRAADD} component={Pages.TraAddPage} layout={Layouts.TraLayout} />

          <RouteWithLayout exact path={Routes.RIDDASHBOARD} component={Pages.RidDashboardPage} layout={Layouts.RidLayout} />
          <RouteWithLayout exact path={Routes.RIDUSER} component={Pages.RidUserPage} layout={Layouts.RidLayout} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
